import React from 'react';

const ListItem = ({ listItems }) => {
  return (
    <ul>
    {
      listItems.map(listItem => {
        const { id, image, task, complete } = listItem;
        return (
            <li className="list" key={id}>
                <img src={image} alt={task} />
                <p>
                    {task }
                </p>
            </li>
        )
      })
    }
    </ul>
  );
}

export default ListItem;
